import React from 'react';
import './Contact.scss';

const Contact = () => {
  const gridItems = [
    {
      title: 'Check out our page on horijon.io',
      // blocks: '64 BLOCKS',
      // date: 'JAN 09, 2022',
      link: 'https://instagram.com/horijon.io'
    },
    {
      title: 'Visit horijon.io instagram page',
      // blocks: '199 BLOCKS',
      // date: 'NOV 02, 2022',
      link: 'https://instagram.com/horijon.io'
    },
    {
      title: 'Visit our YouTube channel "horijononon"',
      blocks: '33 BLOCKS',
      date: 'SEP 23, 2023',
      link: 'https://instagram.com/horijon.io'
    },
    {
      title: 'Check out our google blog with inspirations',
      blocks: '37 BLOCKS',
      date: 'JAN 02, 2022',
      link: 'https://instagram.com/horijon.io'
    }
  ];

  return (
    <section id="contact" className="contact">

      <div className="contact__details">
        Contact
        team@willkommel.com
      </div>
      
      <div className="contact__grid">
        {gridItems.map((item, index) => (
          <a 
            key={index} 
            href={item.link}
            className="contact__grid-item"
          >
            <div className="content">
              <h3>{item.title}</h3>
              {/* <p>{item.blocks} â€¢ {item.date}</p> */}
            </div>
          </a>
        ))}
      </div>
    </section>
  );
};

export default Contact;
